import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPen } from '@fortawesome/free-solid-svg-icons';

function Ranking () {
    return (
        <div>
            Ranking<br/><br/>
            <div>
             <div style = {row}>
                <button style = {botonEdita}>
                    <FontAwesomeIcon icon={faPen} />  &nbsp; &nbsp;
                    <div style = {edita}> Edita </div>
                </button>
             </div>
             <div style = {row}>
                <div style = {column1}>
                    Column 1
                </div>
                <div style = {column2}>
                    Column 2
                </div>
              </div>
        </div>
        </div>
    );
}

const row = {
      display: "flex"
};

const column1 = {
    float: "left",
    width: "20%",
    padding: "10px"
};
const column2 = {
    float: "left",
    width: "80%",
    padding: "10px"
};
const edita = {
    fontSize: 22
};
const botonEdita = {
    padding: "5px"
};

export default Ranking;
